(2428, 1, 'Fernandez', 'Manuel', '', '', '787-462-3502', '', '', 'Indianapolis', 'IN', '', '', '(none)', NULL, 0, 'MANUEL FERNANDEZ MEJIAS, B.A., J.D., LL.M.\r\nDe Diego 89, Suite 105,\r\nPMB 718, San Juan PR 00927\r\nfax 787-753-6482\r\nMobile: 787-462-3502\r\npga@caribe.net\r\nmanuelgabrielfernandez@gmail.com\r\nEDUCATION\r\nGEORGE WASHINGTON UNIVERSITY\r\nWASHINGTON D.C\r\nB.A. HISTORY AND POLITICAL SCIENCE\r\nSEPTEMBER, 1981\r\nGPA 3.75\r\nINTERAMERICAN UNIVERSITY OF PUERTO RICO\r\nSCHOOL OF LAW\r\nSAN JUAN, PUERTO RICO\r\nGPA 3.25\r\nJURIS DOCTOR - CUM LAUDE\r\nMAY, 1984\r\nLAW REVIEW STAFF MEMBER, 1983-84\r\nU.S. ATTORNEY\'S OFFICE - VOLUNTEER\r\nLAW CLERK PROGRAM 1984\r\nUNIVERSITY ACADEMIC SENATE 1982-1983.\r\nFACULTY COMMITTEE ON A.B.A. ACCREDITATION-STUDENT\r\nREPRESENTATIVE STUDENT COUNCIL MEMBER 1982-83.\r\nTULANE UNIVERSITY SCHOOL OF LAW\r\nNEW ORLEANS, LOUISIANA\r\nMASTER OF LAW DEGREE (L.L.M.)\r\nCONCENTRATING IN COMMERCIAL LAW, ANTITRUST LAW,\r\nBANKING LAW AND BANKRUPTCY.\r\nMAY 1985\r\nEXPERIENCE MEJIAS BROTHERS, INC.\r\nPOSITION: VICE-PRESIDENT\r\nResponsible for sales, purchases, financing and general\r\nadministration. Achieved a 125% increase in sales in a two year\r\nperiod. Participated actively in the process of selling the assets of\r\nthe family company to a mayor local food and spirits distributor.\r\nAlso maintained a limited law practice in antitrust, administrative\r\nand corporate law from 1986 to 1989. Participated in one complex\r\nantitrust lawsuit as part of an industry wide defense team.\r\nCARIBBEAN UNIVERSITY\r\nCarolina Campus\r\n1987-1988\r\nPosition: Associated Professor (part-tyime)\r\nCourses: Puerto Rico History, Police Sciences and Criminology\r\nGARCIA & GONZALEZ\r\nApril 1989 to May 1990\r\nPosition : Associate Attorney\r\nConcentrated in Real Estate Development Law, Secured\r\nTransactions, Corporate Finance, Commercial Law, Corporate Law,\r\nAntitrust Law, and Regulated Industries as well as Notarial practice.\r\nParticipated in two complex antitrust lawsuits as part of an industry\r\nwide defense team, working closely with leading economists and\r\nmajor law firms. Also participated in the DuPont Fire Litigation.\r\nIn the real estate area participated in the selling process of various\r\nreal estate developments such as:\r\na) Dorado del Mar Villages\r\nb) Galaxy Condominium in Isla Verde\r\nc) Estancias de San Fernando in Carolina\r\nAssisted in preparing proposals for commercial and residential\r\nprojects representing developers before various governmental\r\nagencies. Participated in commercial financing transactions and in\r\nthe preparation of a public offering memorandum for a commercial\r\nreal estate development. Actively participated in the following real\r\nestate transactions:\r\na) Acquisition of the El Comandante Racetrack and Future\r\nDevelopment\r\nb) San Juan Dockside Area Development\r\nc) Teodoro Moscoso Bridge over the San Jose Lagoon\r\nFERNANDEZ MEJIAS LAW OFFICES\r\nMay 1990 to 2001.\r\nPOSITION: SOLE PRACTIONER\r\nConcentrating in Commercial, Surety and Corporate Law, Real\r\nEstate Development,Regulated Industries Law, Business\r\nAcquisitions, Antitrust Law, Administrative Law, Health Care,\r\nManaged Care contracts, Sale of Health Facilities and Notarial\r\npractice.\r\nAs counsel for the Department of Health participated in the\r\nnegotiation of various agreements with health care insurance\r\ncompanies and services providers as well as in the process for the\r\nimplementation of the Puerto Rico Health Reform Act of 1994.\r\nResponsible for the execution of several complex real estate\r\ntransactions involving environmental, registry of property,\r\nzonification and real estate laws and regulations involving the\r\nfollowing facilities:\r\na) Ponce Regional Hospital\r\nb) Arecibo Regional Hospital\r\nc) Rio Grande CDT\r\nd) Ciales CDT\r\ne) Loiza CDT\r\nAdvised the Department of Health in legislative and\r\nintergovernmental affairs and represented such Department before\r\nthe Legislature and various agencies of the Commonwealth\r\ngovernment.\r\nActed as independent Hearing Officer and legal counsel to the\r\nDepartment of Health of the Commonwealth of Puerto Rico from\r\n1995-2000 in quasi-adversary proceedings.\r\nAs a hearing officer received evidence, examined witnesses and\r\nexpert witnesses in economic and financial matters and made\r\nspecific recommendations in numerous cases related to Certificates\r\nof Need and Convenience for Hospitals, Pharmacies, Laboratories,\r\nX-Ray Facilities and Mental Health Facilities as well as matters\r\nunder the Woman and Infant Children (WIC) Program and the Food\r\nand Drug Program\r\nAuthor of Regulations number 85 (Administrative Procedures) and\r\n89 (Need and Convenience) of the Department of Health as well as\r\nthe first Standing Order issued by the Office of Hearing Examines.\r\nAdvised the local Food and Drug unit of the Department of Health\r\nin matters relating to licensing of food and drug products and the\r\nrevision of rules and procedures including the Food Code.\r\nRepresented clients before the Health Care Financing\r\nAdministration (now CMS) in evidentiary hearings and Medicare\r\nmatters and applications.\r\nRepresented various clients in lobbying efforts for the amendment\r\nor approval of legislative initiatives by visiting members of the\r\nlegislature and their staff members and formulating specific\r\nproposals.\r\nParticipated in three complex antitrust lawsuits as part of an\r\nindustry wide defense team, working closely with leading\r\neconomists and major law firms.\r\nAs counsel for liquefied gas distributors became involved in\r\ncompliance matters, employee training related to new regulations,\r\npreparation of manuals and procedures and other regulatory issues\r\nbefore the U.S. Department of Transportation and the Puerto Rico\r\nPublic Service Commission. Performed comprehensive compliance\r\naudits in operational and administrative matters.\r\nAppointed as Special Master before the Puerto Rico Superior\r\nCourt, Carolina Section in two cases involving corporate disputes\r\nbetween shareholders of corporations.\r\nActed as Administrative Law Judge for special education issues\r\nwith the Education Department of the Commonwealth of Puerto\r\nRico from 2010-2013 in quasi-adversary proceedings.\r\nCOMPAÑIA DE FIANZAS DE PUERTO RICO (Puerto Rico\r\nBonding Co.)\r\nPOSITION: Vice President and Legal Counsel\r\nMarch 2001 to May 2005\r\nResponsible for legal and procedural compliance issues as well as\r\ngeneral managerial duties.\r\nFERNANDEZ MEJIAS LAW OFFICES\r\nJune 2005 to present.\r\nPOSITION: SOLE PRACTIONER\r\nConcentrating in Commercial, Corporate Law, Regulated\r\nIndustries Law, Business Acquisitions, Class Actions,\r\nAdministrative Law, Health Care Law, Managed Care contracts and\r\nMedicare Advantage application procedures for Part D and\r\nManaged Care companies as well as consumer class actions and\r\nspecial education law and procedure.\r\nPROFESSIONAL\r\nAdmitted P.R. Supreme Court, 1986\r\nAdmitted, U.S. District Court, P.R. 1988\r\nMember American Health Lawyers Association 1998-1999\r\nMember Puerto Rico Association of Insurance Companies\r\nCommittee of Property and Casualty 2003-2005\r\nPresident, Puerto Rico Chamber of Commerce\r\nCommittee on Health, 1998-1999.\r\nPresident, Insurance Law Commission , P.R. Bar Association\r\n2004-2006-2010.\r\nMember Board of Directors Trans Oceanic Life Insurance Company\r\n2005-2011.\r\nREPRESENTATIVE P.R. SUPREME COURT DECISIONS\r\nPuerto Rico Fuels v. Empire Gas 149 D.P.R. 691: Established\r\nthat the federal rule of non existence of a right of contribution\r\nbetween co-defendants in an antitrust case does not apply to the\r\nPuerto Rico antitrust legislation.\r\nPressure Vessels v. Empire Gas 137 DPR 497 Leading opinion of\r\nthe Supreme Court of Puerto Rico on antitrust law.\r\nIsmael Herrero Jr. v. Gabriel Alcaraz 2010 TSPR 95. Leading\r\nclass action decision relating to constitutional issues of legislative\r\nactions contingent upon future events and “tie-barring”.\r\nCentro Unido de Detallistas v. Comisión de Servicio Publico\r\n2008 TSPR 116. Leading administrative law decision relating to the\r\nright to challenge governmental regulations.\r\nUiversidad de Ciencias Medicas San Juan Bautista v, E.L.A .\r\n141 DPR 403 (1996) . Leading healthcare law and commercial\r\narbitration decision.\r\nSEMINARS\r\nLegal Aspects of Managed Care\r\nTulane University Medical Center\r\nCenter for Continuing Education\r\nOctober, 1996.\r\nManaged Medicare and Medicaid Reforms\r\nJanuary 1997, Washington. D.C.\r\nManaged Care Legal Aspects-1997 Update\r\nGuest Speaker\r\nPuerto Rico Academy of Medical Directors\r\nSan Juan P.R. January, 1997\r\nPuerto Rico Association of Community Pharmacies\r\nGuest Speaker\r\nAntitrust Aspects of Health Care Law\r\nRio Grande, P.R.\r\nJuly, 1997\r\nHealth care Fraud and Abuse\r\nNational Health Lawyers Association\r\nWashington, D.C.\r\nOctober, 1997\r\nAntitrust in the Healthcare Field\r\nAmerican Health Lawyers Association\r\nWashington, D.C.\r\nFebruary, 1999.\r\nPuerto Rico Association of Financial Professionals\r\nGuest Speaker 2001 Convention\r\n“Surety as an effective Financial Instrument”\r\nSan Juan, P.R. September 2001\r\nLANGUAGES Bilingual English/Spanish', 'Administrative Law Judge , Attorny', '', 1255, -1, '2017-03-21 13:34:55', '2017-03-21 13:37:07', 'manuelgabrielfernandez@gmail.com', '', '', 0, 0, 0, 0, 0, '', '', '', '', 1, 0, '', NULL),
